package de.hbrs.se2.womm.junit.services;

import static org.junit.jupiter.api.Assertions.*;

import com.vaadin.flow.component.html.Image;
import de.hbrs.se2.womm.dtos.NutzerDTO;
import de.hbrs.se2.womm.services.ImageService;
import de.hbrs.se2.womm.views.extra.ASSETS;
import org.junit.jupiter.api.AfterEach;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;

import java.util.Arrays;
import java.util.Random;

public class ImageServiceTest {

    ImageService service;

    @BeforeEach
    void setup() {
        service = new ImageService();
    }

    @AfterEach
    void teardown() {
        service = null;
    }

    @Test
    void testGetImage_NutzerDTONull() {
        Image expect = ASSETS.buildPlaceholder(50, 50);
        Image actual = service.getImage(null);

        assertEquals(expect.getSrc(), actual.getSrc());
        assertTrue(expect.getAlt().equals(actual.getAlt()));
    }

    @Test
    void testGetImage_ProfilePictureNull() {

        NutzerDTO nutzerDTO = NutzerDTO.builder()
                .nutzerId(100)
                .nutzerMail("nutzer@mail.com")
                .nutzerAktiv(true)
                .nutzerOrt("Booetes Void")
                .nutzerProfilbild(null)
                .build();

        Image expect = ASSETS.buildPlaceholder(50, 50);
        Image actual = service.getImage(nutzerDTO);

        assertEquals(expect.getSrc(), actual.getSrc());
        assertTrue(expect.getAlt().equals(actual.getAlt()));
    }

    @Test
    void testGetImage_RandomPicture() {

        NutzerDTO nutzerDTO = NutzerDTO.builder()
                .nutzerId(100)
                .nutzerMail("nutzer@mail.com")
                .nutzerAktiv(true)
                .nutzerOrt("Booetes Void")
                .nutzerProfilbild(getRandomByteArray())
                .build();

        String bytesAsString = Arrays.toString(nutzerDTO.getNutzerProfilbild());
        Image expect = new Image(bytesAsString, "getImage");

        Image actual = service.getImage(nutzerDTO);

        assertEquals(expect.getSrc(), actual.getSrc());
        assertTrue(expect.getAlt().equals(actual.getAlt()));
    }

    @Test
    void testTest() {
        String expectSrc = "data:image/png;base64,";
        Image img = service.test();
        String actualSrc = img.getSrc();

        assertEquals(expectSrc, actualSrc);
        assertEquals("getImage", img.getAlt().get());
    }

    @Test
    void testWorkingImg() {
        String expectSrc = "data:image/png;base64,";
        Image img = service.test();
        String actualSrc = img.getSrc();

        assertEquals(expectSrc, actualSrc);
        assertEquals("getImage", img.getAlt().get());
    }

    @Test
    void testgetRandomImageHeight() {
        Random r = new Random();
        for (int i = 0; i < 100; i++) {
            int height = r.nextInt(-1000, 1000);

            assertDoesNotThrow(() -> service.getRandomImageHeight(height));

            Image image = service.getRandomImageHeight(height);
            assertEquals(height + "px", image.getHeight());

        }

    }

    private byte[] getRandomByteArray() {
        Random r = new Random();
        byte[] result = new byte[r.nextInt(1, 10) * 8];
        r.nextBytes(result);
        return result;
    }
}
